const Projects = () => (
  <div className="main">
    <div>
      <h1>Selected Projects.</h1>
    </div>
    <div className="card-wrapper">
      <div className="card"></div>
      <div className="card card--desc">
        <div className="description">
          <h3>Expensify</h3>
          <p>Fullstack web application made using ReactJS, Firebase, Redux</p>
        </div>
      </div>
    </div>
    <div className="card-wrapper">
      <div className="card"></div>
      <div className="card card--desc"></div>
    </div>
    <div className="card-wrapper">
      <div className="card"></div>
      <div className="card card--desx"></div>
    </div>
    <style jsx>
      {`
        .main {
          display: flex;
          flex-direction: column;
          margin: 0 120px;
          text-align: center;
        }
        h1 {
          font-family: Montserrat;
          font-size: 45px;
          text-align: left;
        }
        .card-wrapper {
          display: flex;
          padding: 25px 0px;
        }
        .card {
          border: 1px solid;
          display: flex;
          height: 350px;
          width: 50%;
        }
        .card--desc {
          border: none;
          box-shadow: 5px 5px 10px #999;
        }
        .description {
          display: block;
          padding: 20px;
          text-align: left;
        }
      `}
    </style>
  </div>
);

export default Projects;
